def textract_worker(queries, object_key, featureTypes):
    
    textract_client = boto3.client('textract')
    
    # 

    # Start the Textract job
    response = textract_client.start_document_analysis(
        # DocumentLocation={'S3Object': {'Bucket': bucket_name, 'Name': object_key}},
        DocumentLocation={'S3Object': {'Bucket': bucket_name, 'Name': object_key}},
        QueriesConfig=queries,
        # FeatureTypes=['QUERIES'],
        FeatureTypes=featureTypes,
    )

    # Get the JobId from the response
    job_id = response['JobId']

    # Poll Textract job status
    max_attempts = 60  # Adjust the number of attempts based on your needs
    wait_interval = 5  # Seconds between each attempt

    for _ in range(max_attempts):
        # Get job status
        job_status = textract_client.get_document_analysis(JobId=job_id)['JobStatus']

        if job_status in ['SUCCEEDED', 'FAILED']:
            break  # Exit the loop if the job is complete or has failed

        time.sleep(wait_interval)

    else:
        print(f'Timeout: Textract job did not complete within {max_attempts * wait_interval} seconds.')
        return

    # Job completed, get the Textract response
    textract_response = textract_client.get_document_analysis(JobId=job_id)
    extract_fields_from_textract_response(textract_response)
    return textract_response
    
    
    
    
    
    
    
    
    


def result_maker(data):
    # Initialize an empty dictionary to store queries and their results
    query_results = {}
    
    # Iterate through the data
    for i in range(len(data) - 1):
        current_block = data[i]
        next_block = data[i + 1]
    
        # Check if the current block is QUERY and the next block is QUERY_RESULT
        if current_block['BlockType'] == 'QUERY' and next_block['BlockType'] == 'QUERY_RESULT':
            # Extract query and result information
            query_id = current_block['Id']
            query_text = current_block['Query']['Text']
            result_id = next_block['Id']
            result_text = next_block['Text']
    
            # Store query and result in the dictionary
            query_results[query_text] = result_text
            
    # print(query_results)
    
    return query_results


