def update_document_class(extracted_fields):
    document_name = extracted_fields['Document Name']
    for document_class, document_names in document_class_mapping.items():
        if any(name in document_name for name in document_names):
            extracted_fields['Document Class'] = document_class
            break
    
    return extracted_fields



def partial_match(key, mapping):
    key_lower = key.lower()
    matching_keys = [k for k in mapping.keys() if key_lower in k.lower()]
    return mapping[matching_keys[0]] if matching_keys else None


