def extract_all_tables_data(tables):    
    all_tables_data = {}
    
    for table_index, table in enumerate(tables, start=1):
        table_key = f"table_{str(table_index).zfill(2)}"
        all_table_rows = []
        
        total_columns = 0
    
        for r in table["Relationships"]:
            if r["Type"] == 'CHILD':
                all_childrens = r["Ids"]
                each_row = []
    
                for child_id in all_childrens:
                    # Find the Cell block based on the child ID
                    cell_block = next((block for block in every_all_block if block['Id'] == child_id and block['BlockType'] == 'CELL'), None)
                    
                    if cell_block and 'EntityTypes' in cell_block and 'COLUMN_HEADER' in cell_block['EntityTypes']:
                        total_columns += 1

    
                    if cell_block:
                        # Iterate through CHILD relationships of the Cell block
                        for relationship in cell_block.get('Relationships', []):
                            if relationship['Type'] == 'CHILD':
                                child_text = ""
                                # Iterate through the IDs of child blocks of the Cell block
                                for child_block_id in relationship['Ids']:
                                    # Find the Word or Line block based on the child block ID
                                    word_line_block = next((block for block in every_all_block if block['Id'] == child_block_id and block['BlockType'] in ['WORD', 'LINE']), None)
    
                                    if word_line_block and 'Text' in word_line_block:
                                        # Extract and print the text from Word or Line block
                                        child_text = word_line_block['Text']
                                each_row.append(child_text)
                        
    
                # Append the row to the list of rows
                all_table_rows.append(each_row)
        # print(total_columns)
    
        two_d_list = [all_table_rows[0][i:i + total_columns] for i in range(0, len(all_table_rows[0]), total_columns)]
        # print(two_d_list)
        # Assign the list of rows to the table key in the dictionary
        # all_tables_data[table_key] = all_table_rows
        all_tables_data[table_key] = two_d_list
        
    return all_tables_data
    




